INSERT INTO `content_feed` VALUES (1,'CHIPPR FIT YOGA',0,'A Strong Core For Better Resilience','https://s3.amazonaws.com/101sessions/visual/BetterResilience.jpg','https://youtu.be/Vz4oLZw5jXw?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Every time you carry groceries, laundry or even your kids, you’re relying on your core as a foundation of strength. A strong midsection isn’t all about six-pack abs. With David\'s multitude of plank variations, strengthen your entire body, make your core pop, strengthen your lower back, and build your shoulders.','VIDEO',0,0,0,'0','0','0','00:07:26',0,1,NULL,NULL,43,16,32,7,1,0,5),(2,'CHIPPR FIT YOGA',0,'Yoga For Athletes: Hips & Hamstrings','https://s3.amazonaws.com/101sessions/visual/Hips&Hamstrings.jpg','https://youtu.be/Dz-5wHVZ-4s?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','For athletes out there such as runners, hockey players, cyclists, or even those individuals who tend to stay sitting behind a desk all day, tight hips and hamstrings seem to be a common area of discomfort. Join Chippr expert Pete as he guides you through this short 10-minute practice focusing on the hips and hamstrings, releasing tension in the low back as well. Enjoy!','VIDEO',0,0,0,'0','0','0','00:11:31',0,1,NULL,NULL,94,20,32,7,1,0,3),(3,'CHIPPR FIT YOGA',0,'Yoga For Athletes: #1 Warm Up','https://s3.amazonaws.com/101sessions/visual/YogaForAthletes.jpg','https://youtu.be/7NadCbmHoH4?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This is a fantastic complete pre-training muscle and joint warm up for all sports, created by Chippr expert Pete, to minimize injuries. Whether you’re about to jog round the block, join in at the Olympics, or get out the racquets on the courts, this 10 minute sequence stretches all the main muscle groups, preparing you for a safe sporting experience!','VIDEO',0,0,0,'0','0','0','00:09:47',0,1,NULL,NULL,94,22,32,7,1,0,3),(4,'CHIPPR FIT YOGA',0,'Workday Detox','https://s3.amazonaws.com/101sessions/visual/Detox.jpg','https://youtu.be/VA3tgi4lfnk?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This is a strong sequence of standing poses, abdominals, deep twists and hip openers that will systematically cleanse and detoxify the body, leaving you feeling refreshed and revitalized from the inside out. Follow Chippr expert Pete through these deep twists to still the mind as you wring out the body and powerfully connect to your center','VIDEO',0,0,0,'0','0','0','00:10:09',0,1,NULL,NULL,94,22,32,7,1,0,3),(5,'CHIPPR FIT YOGA',0,'#1 Sun Salutations: Warm up, Stretch & Strengthen','https://s3.amazonaws.com/101sessions/visual/Stretch&Strengthen.jpg','https://youtu.be/hQ6lRxIJtH0?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Warm up the body with a slow flow in B-series. This three-part series uses creative sun salutation variations to build heat and increase balance and flexibility. This sequence led by Chippr expert Pete, opens the hips and strengthens the legs.','VIDEO',0,0,0,'0','0','0','00:12:51',0,1,NULL,NULL,94,22,32,7,1,0,3),(6,'CHIPPR FIT YOGA',0,'#2 Sun Salutations: Turn Up the Heat','https://s3.amazonaws.com/101sessions/visual/TurnUptheHeat.jpg','https://youtu.be/IZ0QK-4cFdM?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This strengthening practice incorporates twists and balance to lengthen the core and increase flexibility in the hips and legs. Join Chippr expert Pete in this lunge series and open up the quads','VIDEO',0,0,0,'0','0','0','00:11:37',0,1,NULL,NULL,94,22,32,7,1,0,3),(7,'CHIPPR FIT YOGA',0,'#3 Fast Paced Salutations','https://s3.amazonaws.com/101sessions/visual/Paced.jpg','https://youtu.be/MHKrDQYoUi8?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This faster paced series incorporates Warrior 1 and lunge variations to quickly build heat and increase heart rate. This vigorous and challenging workout, guided by Chippr expert Pete, is going to get your blood pumping, get you sweating, and leave you feeling great in no time.','VIDEO',0,0,0,'0','0','0','00:09:48',0,1,NULL,NULL,94,22,32,7,1,0,3),(8,'CHIPPR FIT YOGA',0,'#1 Build the Core','https://s3.amazonaws.com/101sessions/visual/BuildtheCore.jpg','https://youtu.be/mSl0R__eLXQ?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This level one practice led by Chippr expert Pete, slowly builds heat from tabletop and plank, offering support for the lower back while incorporating challenging up-level options for more intermediate and advanced practitioners.','VIDEO',0,0,0,'0','0','0','00:10:49',0,1,NULL,NULL,94,16,32,7,1,0,3),(9,'CHIPPR FIT YOGA',0,'#2 Strengthen the Core','https://s3.amazonaws.com/101sessions/visual/BuildtheCore2.jpg','https://youtu.be/qxc9bHxvsPM?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This level two sequence led by Chippr expert Pete, works the core with mindful repetitions from both downward dog and plank pose, ending with supportive backbends to release tension in the lower back.','VIDEO',0,0,0,'0','0','0','00:10:04',0,1,NULL,NULL,94,16,32,7,1,0,3),(10,'CHIPPR FIT YOGA',0,'#3 Rock the Core','https://s3.amazonaws.com/101sessions/visual/BuildtheCore3.jpg','https://youtu.be/NvyfJiKsK1w?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','If you’d like to improve your core, Chippr expert Pete has the moves for you. This is an advanced level three sequence, incorporating sun salutations with intense abdominal work to build heat.','VIDEO',0,0,0,'0','0','0','00:10:38',0,1,NULL,NULL,94,16,32,7,1,0,3),(11,'CHIPPR FIT YOGA',0,'Take Your Ab Strength to the Next Level','https://s3.amazonaws.com/101sessions/visual/AbStrength.jpg','https://youtu.be/GvtCl_cUt3g?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','You’ve heard time and again, the classic “Boat pose,” described as the perfect ab toning move. But is it really? Well, that all depends on how it’s taught! Follow Chippr expert David, as he leads you through boat pose, step by step, in a few different ways.','VIDEO',0,0,0,'0','0','0','00:06:00',0,1,NULL,NULL,43,16,32,7,1,0,5),(12,'CHIPPR FIT YOGA',0,'Bring Out Your Fierce Side','https://s3.amazonaws.com/101sessions/visual/Fierce.jpg','https://youtu.be/ulmt0w3SUHE?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Find the tension, the balance, of working your legs powerfully and stably as you lift through the crown of your head. This sequence led by Chippr expert David, is quite stimulating and warming, making it a great choice for cold winter.','VIDEO',0,0,0,'0','0','0','00:07:45',0,1,NULL,NULL,43,22,32,7,1,0,5),(13,'CHIPPR FIT YOGA',0,'The Ultimate Daily Stretch','https://s3.amazonaws.com/101sessions/visual/DailyStretch.jpg','https://youtu.be/V3Kz2871it4?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Facing a time Crunch? Welcome to this 10 minute Advanced Sun Salutation class, led by Chippr expert David. The best part about this class is that it works well for those “super busy people,” who often complain about not being able to stay fit because of a time crunch. This is a great practice to learn since it is more invigorating and more strengthening','VIDEO',0,0,0,'0','0','0','00:08:19',0,1,NULL,NULL,43,22,32,7,1,0,5),(14,'CHIPPR FIT YOGA',0,'Loosen Up! Get More Flexible','https://s3.amazonaws.com/101sessions/visual/Flexible.jpg','https://youtu.be/tGEZtFzUZTg?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Flexibility is a “use it or lose it” type of thing. In this fit flow sequence, David will lead you through two different versions of Sun Salutations which will help you become more flexible, whether you\'re just trying to touch your toes or if you\'re aiming to finally be able to do the splits.','VIDEO',0,0,0,'0','0','0','00:08:21',0,1,NULL,NULL,94,22,32,7,1,0,5),(15,'CHIPPR FIT YOGA',0,'#1 Strong Core For A Strong Back','https://s3.amazonaws.com/101sessions/visual/StrongBack.jpg','https://youtu.be/IIcA2ZOI0js?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','Whether you’re hitting a tennis ball or mopping the floor, the necessary motions either originate in your core, or move through it. These are just a few of the many mundane actions that rely on your core and that you might not notice until they become difficult or painful. Start working this area right away with Chippr expert David, lengthen and loosen your back, as well as strengthen your entire core, which is essential to protect your spine.','VIDEO',0,0,0,'0','0','0','00:10:19',0,1,NULL,NULL,43,16,32,7,1,0,5),(16,'CHIPPR FIT YOGA',0,'#2 For a Crazy Strong Core','https://s3.amazonaws.com/101sessions/visual/Crazy.jpg','https://youtu.be/wa_uaGJT04w?list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This 10-minute fit flow sequence is designed to carve a stronger core, whether you\'re a yoga newbie or a professional poser. Guided by Chippr expert David, this is a mind and body booster.','VIDEO',0,0,0,'0','0','0','00:06:43',0,1,NULL,NULL,43,16,32,7,1,0,5),(17,'CHIPPR THERAPY',0,'#1 A Pain in the Neck? ','https://s3.amazonaws.com/101sessions/visual/painintheneck_img.jpg','https://youtu.be/fIt5Hpw-fgA?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','If you notice this, quite a lot of your colleagues, friends & family members are probably telling you how their neck isn’t feeling so good, and you might be in that board also. There’s a lot of neck pain going on and a big part is due to bad posture and the stress of modern jobs. Join Dr.Baxter Bell in this short sequence of “Reclining and Seated-Arm and Neck movements”, to reduce pain in the neck and upper back.','VIDEO',0,0,0,'0','0','0','00:07:26',0,1,NULL,NULL,0,0,0,50,0,0,6),(18,'CHIPPR THERAPY',0,'#2 Ever Wake up with a Crick in Your Neck?','https://s3.amazonaws.com/101sessions/visual/cricinyourneck_img.jpg','https://youtu.be/pp-MC9l9NdY?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','Have you ever woken up with a crick in your neck, making it painful to turn your head or even use the affected arm? Knocking your neck out of place when you sleep isn’t the only cause of a crick, the problem may simply be a common consequence of the modern lifestyle. If cricks are a common occurrence for you, follow Dr.Baxter Bell and try to get your neck moving again by performing two simple stretches called the “Bear hug arms, and Eagle arms”. Try them both to learn which gives you greatest help.','VIDEO',0,0,0,'0','0','0','00:07:24',0,1,NULL,NULL,0,0,0,50,0,0,6),(19,'CHIPPR THERAPY',0,'#1 Do You Have Text Neck?','https://s3.amazonaws.com/101sessions/visual/textneck_img.jpg','https://youtu.be/YiHhVcgh8Lo?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','The posture of bending your neck to look down does not occur only when texting. For years, we\'ve all looked down to read. The problem with texting is that it adds one more activity that causes us to look down— for much longer periods. Get ready to follow “Chin Lift”, “Dynamic Warrior-1”, and “Reclined Chest-Opener”, with Dr.Baxter bell and the only pain in the neck you’ll experience will be your neighbor’s dogs barking at 2 a.m.!','VIDEO',0,0,0,'0','0','0','00:10:12',0,1,NULL,NULL,0,0,0,50,0,0,6),(20,'CHIPPR THERAPY',0,'#2 Text Neck-The Latest Global Epidemic!','https://s3.amazonaws.com/101sessions/visual/epidemic_img.jpg','https://youtu.be/AfcoXc4J00E?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','Virtually unheard of two years ago, \"Text Neck\" is a modern habit that\'s becoming more common. Looking down at your smart phone, with your chin to your chest, not only changes the natural curvature of your neck but also restricts your lung\'s ability to expand. Join Dr.Baxter Bell as he guides you through Reverse Vulcan Mind Meld, as a way of bringing your neck and head back over the shoulders instead of way out in front of you. Come, bring yourself back into alignment!','VIDEO',0,0,0,'0','0','0','00:06:35',0,1,NULL,NULL,0,0,0,50,0,0,6),(21,'CHIPPR THERAPY',0,'#1 A Mini Retreat For Heel Pain','https://s3.amazonaws.com/101sessions/visual/heelpain.jpg','https://youtu.be/it3YlH8X2aA?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','Feet. They carry you from here to there every day. But you may not think much about them until they hurt. Heel Pain is hard to heal, the heel once it becomes angry and inflamed is one of the hardest part of the body to get to quiet down. 