 Twist”, a great stress reliever that might be helpful as you begin your journey toward losing the unwanted weight gain.','VIDEO',0,0,0,'0','0','0','00:07:48',0,1,NULL,NULL,0,0,0,55,0,0,6),(31,'CHIPPR THERAPY',0,'#1 The Cure for Frozen Shoulder','https://s3.amazonaws.com/101sessions/visual/frozenshoulder.jpg','https://youtu.be/gj82yWo70Ds?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','Stiff shoulders are usually uncomfortable, even if the degree of stiffness is not great. Join Dr. Baxter Bell, speed up your healing process and improve your range of motion as he guides you through this short therapeutic sequence.','VIDEO',0,0,0,'0','0','0','00:08:16',0,1,NULL,NULL,0,0,0,56,0,0,6),(32,'CHIPPR THERAPY',0,'#2 Do you want Pain Free Shoulders?','https://s3.amazonaws.com/101sessions/visual/painfreeshoulders.jpg','https://youtu.be/dC-WZRGPJLU?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','A lack of shoulder mobility is often a precursor to shoulder pain. If you lack full mobility of the shoulder then getting this back should be high on your list of priorities, if protecting your shoulders is something you are interested in. Follow Dr.Baxter Bell as he walks you through “ The Powerful Pose”, overtime get those cranky painful shoulders to quiet down and become pain free.','VIDEO',0,0,0,'0','0','0','00:05:13',0,1,NULL,NULL,0,0,0,56,0,0,6),(33,'CHIPPR THERAPY',0,'#1 Sprained Ankle? Now what?','https://s3.amazonaws.com/101sessions/visual/sprainedankle.jpg','https://youtu.be/izuYQnqQ0Hg?list=PLYS1_re0fKyVjc0vaZOJBuBJDE1zn9YrX','In this short sequence, Dr.Baxter Bell shares his expertise on how to get your ankles back in shape. If you had an ankle sprain or suffered a fracture in your legs and got a good healed bone, but in the due course your muscles have become weak or may be the ankle has become very stiff, this class is for you! Come, it’s time to develop your ankle strength and coordination to pre-injury levels.','VIDEO',0,0,0,'0','0','0','00:11:22',0,1,NULL,NULL,0,0,0,57,0,0,6),(34,'C