ded Meditation in Queen’s Pose”, led by Prenatal expert Jane. Just let yourselves arrive. You deserve this!','VIDEO',0,0,0,'0','0','0','00:11:02',0,1,NULL,NULL,0,0,0,0,0,3,7),(40,'CHIPPR PRENATAL',0,'Break Free from Stress: Head to Toe Relaxation','https://s3.amazonaws.com/101sessions/visual/toerelaxation.jpg','https://youtu.be/Oh8x_TM0y3k?list=PLYS1_re0fKyXLLqgdH6grhMw9SIC8YA7l','While normal levels of stress are unlikely to be detrimental to the health of an unborn child, excessive stress may be detrimental. Even a modest amount of relaxation will release those feel good endorphins, reduce stress, anxiety and depression, lift your mood and make it easier to sleep. Join Prenatal Yoga expert Jane in this 10 minute “Head to Toe Relaxation”, break free from stress and boost your baby’s potential.','VIDEO',0,0,0,'0','0','0','00:09:04',0,1,NULL,NULL,0,0,0,0,0,3,7),(41,'CHIPPR PRENATAL',0,'Keep Your Pelvic Floor Strong!','https://s3.amazonaws.com/101sessions/visual/pelvicfloorstrong.jpg','https://youtu.be/sV_WaVhuXUg?list=PLYS1_re0fKyXLLqgdH6grhMw9SIC8YA7l','If there\'s one exercise you should do without fail every day during pregnancy, it\'s the pelvic floor lift. A toned Pelvis is flexible and will help during the birth and prevent stress incontinence afterwards. You can do this “ Wave Squat and Polar Bear Pose “anywhere at any time!\' Join Prenatal Yoga expert Jane, keep your pelvic floor nice and strong.','VIDEO',0,0,0,'0','0','0','00:07:31',0,1,NULL,NULL,0,0,0,0,0,6,7),(42,'CHIPPR PRENATAL',0,'#1 Get Rid of Cankles!','https://s3.amazonaws.com/101sessions/visual/cankles.jpg','https://youtu.be/QaLYOw8OX9c?list=PLYS1_re0fKyXLLqgdH6grhMw9SIC8YA7l','Poor little neglected ankles, we ignore them until it gets puffy and then we hate them! They’re not lovely to look at, but cankles during pregnancy are usually not harmful - just another occupational hazard of being a mom-to-be. Improve circulation in your ankles with Prenatal Yoga Expert Jane as she walks you through “Wave S