d1.cloudfront.net/audio/mb/V26.mp3','Imagining a peaceful walk in a forest can make you feel revitalized, centered, calm, peaceful, and refreshed, - as if you really took that walk.','AUDIO',0,0,10,'0','0','0','00:02:31',0,1,NULL,NULL,0,0,0,77,1,0,8),(164,'FEEL GOOD POSITIVE THINKING',0,'Aggravated ~ Angry ~ Antagonized ~ Mad ~ Offended ~ Bristling ','0','https://s3.amazonaws.com/101sessions/audio/FG/anger.mp4','Anger is a very social emotion; if you can understand its nuances and subtleties, you can function more intelligently in your social world. But if you have too much anger, you’ll continually offend against the rights of others. Simply listen to Patti, with an open and relaxed state of mind to help you channel that intensity into healthy action.','AUDIO',0,0,0,'0','0','0','00:04:41',0,1,NULL,NULL,0,0,0,84,0,0,9),(165,'FEEL GOOD POSITIVE THINKING',0,'Afraid ~ Fearful ~ Jumpy ~ Nervous ~ Shaky  ~ Unsettled  ~ Worried','0','https://s3.amazonaws.com/101sessions/audio/FG/fear.m4a','Fear is a lifesaving emotion that primes your brain, your muscles, and all of your senses for action. If your fear is stuck in a feedback loop, you may become overwhelmed and exhausted by the activation it causes. Simply listen to Patti, work with your fear, understand when it is healthy and appropriate, and when it is repetitive and unhelpful to you. ','AUDIO',0,0,0,'0','0','0','00:03:15',0,1,NULL,NULL,0,0,0,85,0,0,9),(166,'FEEL GOOD POSITIVE THINKING',0,'Grief-stricken ~ Heartbroken ~ Hopeless ~ Inconsolable ~ Morose','0','https://s3.amazonaws.com/101sessions/audio/FG/grief.mp4','Grief arises when you have no choice about letting go, and when you’re losing something over which you have no control. Grieving is a slow and languid process that takes its own time. As you listen to Patti, you’ll find support for your grieving process, and you won’t be hurried or shamed out of your honest emotions. ','AUDIO',0,0,0,'0','0','0','00:03:55',0,1,NULL,NULL,0,0,0,86,0,0,9),(167,'FEEL GOOD POSITIVE THINKING',0,'Ashamed ~ Chagrined ~ Contrite ~ Culpable ~ Embarrassed ','0','https://s3.amazonaws.com/101sessions/audio/FG/shame.wav','Shame is the natural emotional consequence of guilt and wrongdoing. If we don’t know that and don’t welcome our authentic shame, we’ll be unable to moderate our our own behavior. We’ll continually do things we know are wrong — and we won’t have the strength to stop ourselves. In this short audio session, Patti helps you understand the positive aspects of shame.','AUDIO',0,0,0,'0','0','0','00:04:18',0,1,NULL,NULL,0,0,0,87,0,0,9),(168,'FEEL GOOD POSITIVE THINKING',0,'Guilt-ridden ~ Guilt-stricken ~ Humiliated ~ Mortified -  Self-condemning','0','https://s3.amazonaws.com/101sessions/audio/FG/guilt.wav','Guilt is a factual state, not an emotional one. You’re either guilty or not guilty. If you’re not guilty, there’s nothing to be ashamed of. However, if you are guilty, and you want to know what to do about the fact of your guilt, then listen to Patti.','AUDIO',0,0,0,'0','0','0','00:05:29',0,1,NULL,NULL,0,0,0,88,0,0,9),(169,'FEEL GOOD POSITIVE THINKING',0,'Anxious ~ Disquieted ~ Doubtful ~ Edgy ~ Fidgety','0','https://s3.amazonaws.com/101sessions/audio/FG/anxiety.m4a','At its most subtle level, anxiety helps you plan for the future and complete important tasks. In its intense state, your anxiety might set itself into a tizzy of activation. It might spin out and take you from room to room completing three tasks badly and four not at all. In this short saudio ession with Patti, you can calm down a bit, ground and focus yourself.','AUDIO',0,0,0,'0','0','0','00:04:31',0,1,NULL,NULL,0,0,0,89,0,0,9),(170,'FEEL GOOD POSITIVE THINKING',0,'Confused ~ Curious ~ Disconcerted ~ Disoriented ~ Apprehensive','0','https://s3.amazonaws.com/101sessions/audio/FG/confusion+.mp4','Confusion actually tries to protect you by halting your actions, but it can easily spiral into a persistent and unresolving state. It’s fine to be confused, but it’s important to know why confusion appears. Listen to Patti, unmask your confusion, revive your instincts and intuition and discover why you’re unable to take decisive action.','AUDIO',0,0,0,'0','0','0','00:04:39',0,1,NULL,NULL,0,0,0,90,0,0,9),(171,'FEEL GOOD POSITIVE THINKING',0,' Depressed ~ Despondent - Downtrodden ~ Drained ','0','https://s3.amazonaws.com/101sessions/audio/FG/depression.wav','Depression is, as every emotion is, a message about and a reaction to things that are going on inside or around you. It’s important to pay attention to that message and deal with whatever is going on. As you listen to Patti, you will be able to focus upon yourself with empathy & view your depression not as a negative commentary about your intrinsic value, but as a vital message about the specific issues you face.','AUDIO',0,0,0,'0','0','0','00:05:44',0,1,NULL,NULL,0,0,0,91,0,0,9),(172,'FEEL GOOD POSITIVE THINKING',0,'Desirous ~ Cravings - Wishfulness','0','https://s3.amazonaws.com/101sessions/audio/FG/desire+.mp4','This short audio session is about realizing that everything you desire is available when you seek fulfillment from the inside rather than from the outside.  It’s about understanding that what you’re experiencing on the outside is a reflection of what you’re experiencing on the inside.  It’s about shifting your perspective 180 degrees ­ from outside yourself to inside yourself. ','AUDIO',0,0,0,'0','0','0','00:05:36',0,1,NULL,NULL,0,0,0,92,0,0,9),(173,'',0,'Barre Booty Workout for Better Buns, Abs and Thighs','0','https://www.youtube.com/watch?v=nUDqNuLsi8c&index=7&list=PLe5P3ayTEj7a6S6qyYaia6gPNme99v8cV','Lift your buns, shape your thighs and sculpt your abs too with this short, but effective, barre style workout! The entire routine is squat and lunge free (and it\'s floor work free!) making it a great alternative lower body workout if you suffer from knee issues. ','VIDEO',0,0,0,'0','0','0','00:13:48',0,1,NULL,NULL,44,16,30,7,1,0,1),(174,'',0,'Barre Booty Workout for Better Buns, 