INSERT INTO `instructor` VALUES (1,'Jessica Smith','As someone who struggled to lose weight for years, Jessica found that the key to her own 40-pound weight loss was making small, healthy lifestyle changes that led to big, lasting results. Now, as a certified wellcoach, fitness instructor and personal trainer, she has spent the last 15 years helping students and clients reach their goals in New York City, Los Angeles and Miami','https://s3.amazonaws.com/101sessions/Bio-Pics/jessica-smith.jpg',NULL,NULL),(2,'Laura Burkhart','Laura\\\'s creative and intelligently sequenced flow classes are known for being challenging, with a smooth and rhythmic flow. She has modeled in numerous Yoga Journal online videos, was spotlighted in Origin Magazine, and was the June 2010 master class model for Yoga Journal Magazine. Laura worked as the Yoga Director at the San Francisco Bay Club\\\'s Mind/Body Center and now dedicates her time to her students online, in public classes, at conferences and in workshops!','https://s3.amazonaws.com/101sessions/Bio-Pics/Laura.jpg',NULL,NULL),(3,'Pete Guinosso','Pete’s teaching style is best described as a Forrest Yoga Inspired Vinyasa Flow. If you’re new to yoga and not quite sure what that means, the best way to explain his classes is they are designed to help you journey toward connecting your mind, body and spirit through breath work and awareness. Powerful sequences are designed to create a fluid practice of meditative movement, while also cultivating an awareness of alignment. Sometimes we laugh, sometimes we cry, but no matter what, we always work on building strength and flexibility. And we always sweat! ','https://s3.amazonaws.com/101sessions/Bio-Pics/PeteGuinosso.jpg',NULL,NULL),(4,'Stacie Dooreck','Stacie Dooreck is the creator and author of the SunLight Chair Yoga: yoga for everyone! book. ebook and teacher trainings and is a certified Yoga instructor since 1995. Stacie teaches at Bay Area, CA companies and chair yoga for seniors.\\nStacie was featured on NPR radio/KQED. CBS Miami Health Watch News said:  \\\"Stacie is breathing new life into S. Florida Seniors.','https://s3.amazonaws.com/101sessions/Bio-Pics/Stacie.jpg',NULL,NULL),(5,'David Moreno','David began practicing yoga in the late 70’s studying the Iyengar and Ashtanga styles of yoga before studying Anusara and the Bihar methods of yoga. He continues his studies in Ayurveda and Tantra, delving deeper into the primordial tantric roots of the yoga tradition. David is known for his keen sense of humor and timing, making his teaching both playful and informative. When not traveling, he teaches in the San Francisco bay area.','https://s3.amazonaws.com/101sessions/visualization/v01.jpg',NULL,NULL),(6,'Baxter Bell','Baxter Bell, MD, has been actively deepening his understanding of yoga and relaxation since making the stress-reducing move from a career as a busy family doctor to that of a yoga teacher and medical acupuncturist. Image 1He is a graduate of the Piedmont Yoga Studio?s 18-month Advanced Studies Program, and has since become Director of PYS?s Deep Yoga Program, teaching the Experiential Anatomy, Yoga Technique, and Yoga Methodology portions of the training. He is also on faculty for several Teacher Training programs around the country, including the Therapeutic Yoga Teacher Training program at the Niroga Institute in Berkeley, CA.','https://s3.amazonaws.com/101sessions/Bio-Pics/BaxterBell.jpg',NULL,NULL),(7,'Jane Austin','Jane Austin is the founder and director of Mama Tree, a Yoga Alliance registered school dedicated to training yoga teachers, birth professionals and other health professionals interested in teaching prenatal and postnatal yoga. As a certified yoga teacher and a registered yoga teacher trainer through Yoga Alliance, Jane?s teacher training program attracts students from all over the world interested in learning how to utilize the practice of yoga to support pre- and postnatal women physically, mentally and emotionally.','https://s3.amazonaws.com/101sessions/Bio-Pics/JaneAustin.jpg',NULL,NULL),(8,'Meisha Bosma ','Meisha Bosma came to yoga and meditation to heal, and this makes her offerings passionate and inspiring. With a gift to hold sacred space for others, Meisha’s work sparks the unfolding of inner wisdom and spiritual awakening. Using movement, chakras, chanting, sound, poetry, color, mantras, mudras and meditation, the optimizing of healing and health is at the forefront of her explorations. Your time with Meisha will strengthen your intuitive skills and ability to self-express with confidence. With a genuine and personal touch, you are guided back to your inherent wholeness and the discovery of your true Self, whose essence is pure love.','https://s3.amazonaws.com/101sessions/Bio-Pics/MeishaBosma.jpg',NULL,NULL),(9,'Patti Gfeller Stark','Patti Stark, owner and instructor at Serenity on the Square in Liberty, MO, is also a truly devoted practitioner of holistic approaches to managing life and challenges we all face at times. Her approach to finding strength, peace and tranquility in life and managing the effects of stress on our mind and body is truly inspiring. She is uniquely qualified and has the natural personality type to assist her clients with the promotion of a healthy and harmonious lifestyle.','https://s3.amazonaws.com/101sessions/visualization/v01.jpg',NULL,NULL),(10,'Darren Mein','Darren Main is a Hatha flow and Restorative Yoga Instructor and author. His books include Yoga and the Path of the Urban Mystic, Spiritual Journeys along the Yellow Brick Road, The Find horn Book of Meditation and Hearts and Minds: Talking to Christians about Homosexuality. In addition to his writing, he facilitates workshops and gives talks on yoga and modern spirituality throughout the United States and abroad','https://s3.amazonaws.com/101sessions/Bio-Pics/DarrenMain.jpg',NULL,NULL);
